import  Images2 from '../images/2.jpg'
function Prodact(propes){
const{Prdact}=propes
        return(
        <div key={Prdact.id} className="card" style={{width: "18rem",minHeight:"800px"}}>
        <img src={Images2}className="card-img-top" alt="..." />
        <div className="card-body">
        <h5 className="card-title">{Prdact.title}</h5>
        <p className="card-text">{Prdact.description}</p>
        {/* <Link to={`/about/${Prodact.id}`}>Deteles</Link> */}
        </div>
        </div> 
        )
        }
      

export default Prodact
